import React from 'react';
import './App.css';

const key = process.env.APCA_API_KEY_ID;
const secret = process.env.APCA_API_SECRET_KEY
function App() {
    function name() {
        fetch(` https://paper-api.alpaca.markets/v2/account `,
        {
            headers: {
                'APCA-API-KEY-ID': key,
                'APCA-API-SECRET-KEY': secret,
            }
        }).then((res) => {
            return res.json;
        })
    }
    return (
        <div id="Title">
            Stock Portfolio
            <div id = "name">
                {name()}
            </div>
        </div>
    );

}

export default App;
